import styles from "./css/ErrorPage.module.css";
import err400 from "./400-p.jpg";

class ErrorPage extends Component {
  state = {
    articles: null,
    isLoading: true,
    num: 1
  };

  componentDidMount() {}

  render() {
    console.dir(this.props);
    return (
      <div>
        <img
          style={{ display: this.state.num === 1 ? "block" : "block" }}
          className={styles.errorImage}
          src={err400}
          alt="Error 400: Bad request."
        />
        {/* <img src="./src/404-p.jpg" alt="Error 400: Page not found." />
        <img src="./src/500-p.jpg" alt="Error 400: Server error." /> */}
      </div>
    );
  }
}

export default ErrorPage;
